INSERT INTO `substitution` VALUES (1,0,'sl','Med prvimi je zamisel o atomu razvil grÃ…Â¡ki filozof Demokrit. NekoÃ„Â je sedel na kamnu ob morski obali, drÃ…Â¾al v roki jabolko in takole razmiÃ…Â¡ljal, da Ã„Âe razreÃ…Â¾e jabolko na polovico, dobi pol jabolka, Ã„Âe nadaljuje s polovico, dobi Ã„Âetrtino in tako naprej. VpraÃ…Â¡al se je, ali lahko reÃ…Â¾emo tako kar naprej. Demokrit je iz tega razmiÃ…Â¡ljanja povzel, da je Ã…Â¡tevilo delitev omejeno. Po doloÃ„Âenem Ã…Â¡tevilu deljenj bi dobili delec, ki ga ne moremo deliti naprej. Ta delec je imenoval atom.'),(2,0,'sl','Pascal velja za enega najveÃ„Âjih neuresniÃ„Âenih talentov v zgodovini matematike. Na Ã…Â¾alost se  velikokrat ni ukvarjati z matematiko zaradi teÃ…Â¾av z zdravjem. Ã…Â½e kot otrok je bil Pascal velikokrat bolan. V Ã…Â¡olo kasneje prav zaradi svojega krhkega zdravja ni hodil, paÃ„Â pa je imel domaÃ„Âega uÃ„Âitelja. Njegov oÃ„Âe se je namreÃ„Â bal, da bi se njegov sin zaradi uÃ„Âenja v Ã…Â¡oli preveÃ„Â izÃ„Ârpal. DomaÃ„Âemu uÃ„Âitelju je celo naroÃ„Âil, naj da deÃ„Âku predvsem dobro humanistiÃ„Âno izobrazbo s poudarkom na latinskem in grÃ…Â¡kem jeziku, izogiba pa se naj zahtevne matematike.'),(3,0,'sl','Malo je ljudi v zgodovini znanosti in tehnike, ki bi toliko prispevali k sploÃ…Â¡nemu napredku Ã„ÂloveÃ…Â¡tva kot prav Nikola Tesla. Ã…Â½e kot majhen otrok si je dobro zapomnil stvari. To naj bi podedoval po materi. Zelo zgodaj je malega Nikola zanimala narava. Po opazovanju narave se je lotil tudi prvih poskusov. Ã…Â e preden je bil star pet let, je skuÃ…Â¡al leteti kot ptiÃ„Â. Njegov polet se je konÃ„Âal s hudim pretresom moÃ…Â¾ganov.Malo je ljudi v zgodovini znanosti in tehnike, ki bi toliko prispevali k sploÃ…Â¡nemu napredku Ã„ÂloveÃ…Â¡tva kot prav Nikola Tesla. Ã…Â½e kot majhen otrok si je dobro zapomnil stvari. To naj bi podedoval po materi. Zelo zgodaj je malega Nikola zanimala narava. Po opazovanju narave se je lotil tudi prvih poskusov. Ã…Â e preden je bil star pet let, je skuÃ…Â¡al leteti kot ptiÃ„Â. Njegov polet se je konÃ„Âal s hudim pretresom moÃ…Â¾ganov.'),(4,0,'sl','Ko je Nikola Tesla bil star devetnajst let, je zaÃ„Âel Ã…Â¡tudirati elektrotehniko. Pri Ã…Â¡tudiju je bil zelo priden in tako zelo zagnan, da je dekan fakultete celo pisal njegovemu oÃ„Âetu, naj sina vzame iz Ã…Â¡ole, ker Ã…Â¡tudij Ã…Â¡kodljivo vpliva na njegovo zdravje. OÃ„Âetu je moral obljubiti, da se bo tudi kaj zabaval. ZaÃ„Âel je igrati karte. Zaradi sposobnosti kombinatornega miÃ…Â¡ljenja je veÃ„Âinoma dobival. Denar pa je na koncu vedno vraÃ„Âal tistim, ki so ga izgubili.'),(5,0,'sl','William Herschel se je zapisal v zgodovino astronomije kot konstruktor\ndaljnogledov, kot neumoren opazovalec neba, prvi raziskovalec Rimske ceste in drugih galaksij. Kot mladeniÃ„Â je iz rodne NemÃ„Âije pobegnil v Anglijo. V zaÃ„Âetku je bil godbenik, komponist in uÃ„Âitelj glasbe, kasneje pa je spremenil poklic in postal eden najveÃ„Âjih astronomov. Bil je samouk v glasbi in v astronomiji. Gradil je vse veÃ„Âje daljnoglede, ki jih je poÃ…Â¡iljal na vse strani.'),(6,0,'sl','Kopernik je s svojim delom moÃ„Âno vplival na vso znanost in spremenil Ã„Âlovekov pogled na svet. Ã…Â½ivel in ustvarjal je na prehodu iz srednjega veka v novi vek, ko so fevdalno druÃ…Â¾bo pretresali pomembni dogodki. Znanje astronomije je bilo nujno potrebno pri trgovanju na dolgih morskih poteh. Misel o okrogli Zemlji je postajala sploÃ…Â¡no znana. Vsemu temu je sledila Ã…Â¡e  nova predstava o zgradbi vesolja. Do Kopernika so mislili, da je Zemlja nepremiÃ„Âna, da leÃ…Â¾i v srediÃ…Â¡Ã„Âu vesoljstva in da se vse zvezde, planeti, Sonce in Luna gibljejo okoli nje.'),(7,0,'sl','Rodil se je v revni kmeÃ„Âki druÃ…Â¾ini v zasavskem hribovju. Kot matematika ga najbolj poznamo kot avtorja njegovih logaritmov, s katerimi so raÃ„Âunali po svetu v znanosti, Ã…Â¡olstvu in vsakdanjem Ã…Â¾ivljenju vse do mnoÃ…Â¾iÃ„Âne uporabe elektronskih raÃ„Âunalnikov. Kot profesor matematike na Ã…Â¡oli je napisal matematiÃ„Âna in fizikalna uÃ„Âbenika. Ã„Å’eprav je Vega s svojimi logaritmi zaslovel predvsem kot matematik, je bil veÃ„Âji del njegovih razprav in uÃ„Âbenikov posveÃ„Âenih fiziki. Njegova dela v fiziki zajemajo vsa podroÃ„Âja mehanike, predvsem teorijo gravitacije in z njo povezano astronomijo.'),(8,0,'sl','Ideje o dveh gibanjih Zemlje, o vrtenju okoli njene osi in kroÃ…Â¾enju okoli Sonca, so izrekli Ã…Â¾e nekateri filozofi starega veka. Te misli so utonile v pozabo. Povzel jih je Kopernik, ki je postavil Sonce v srediÃ…Â¡Ã„Âe naÃ…Â¡ega planetnega sistema, Zemljo pa premaknil v vrsto planetov, ki se gibljejo okoli Sonca. Kopernikov nauk je pomenil prelom s Ã…Â¡tevilnimi tradicijami in dotedanjim svetovnim nazorom. Ves srednjeveÃ…Â¡ki svet se je naslanjal na nespremenljivost obstojeÃ„Âega reda. Le drzni ljudje so si upali izreÃ„Âi misel o gibanju Zemlje.'),(9,0,'sl','William Herschel se je zapisal v zgodovino astronomije kot konstruktor daljnogledov, kot neumoren opazovalec neba, prvi raziskovalec Rimske ceste in drugih galaksij. Kot mladeniÃ„Â je iz rodne NemÃ„Âije pobegnil v Anglijo. V zaÃ„Âetku je bil godbenik, komponist in uÃ„Âitelj glasbe, kasneje pa je spremenil poklic in postal eden najveÃ„Âjih astronomov. Bil je samouk v glasbi in v astronomiji. Gradil je vse veÃ„Âje daljnoglede, ki jih je poÃ…Â¡iljal na vse strani.'),(10,0,'sl','Kolmogorov se je ukvarjal s Ã…Â¡irokim poljem matematike. Opredelil je matematiÃ„Âne osnove verjetnostne teorije in algoritmiÃ„Âne teorije nakljuÃ„Ânosti ter prispeval kljuÃ„Âne prispevke k osnovam statistÃ„Âne mehanike, stohastiÃ„Ânih procesov, teorije informacije, mehanike tekoÃ„Âin in nelinearne dinamike. Vsa ta podroÃ„Âja in njihovi odnosi so osnova za kompleksne sisteme, kot jih danes preuÃ„Âujejo.'),(11,0,'sl','S svojimi daljnogledi je Ã…Â¡tirikrat skrbno pregledal vse nebo, ki ga je lahko videl iz Anglije. Pri tem je naÃ…Â¡el nov planet Uran. Glavne raziskave je posvetil zvezdam. S svojimi daljnogledi je lahko prodrl globoko v vesolje. Pri tem je ugotovil, da OsonÃ„Âje ne miruje.'),(12,0,'sl','V vsakdanjem Ã…Â¾ivljenju imenujemo paradoks nekaj, kar je sicer resniÃ„Âno, pa vendar v nasprotju z naÃ…Â¡imi predstavami in izkuÃ…Â¡njami. Sklepanje iz navidezno pravilnih dejstev, ki nas privedejo do nesmiselnega rezultata, ravno tako imenujemo paradoks.'),(13,0,'sl','Kako znan je bil ta priimek v svetu, pripoveduje naslednji dogodek. Ko je moral nekoÃ„Â Herschel na meji pokazati potni list, je carinik zaÃ„Âuden vzkliknil: \"Herschel, to vendar ni priimek, to je zvezda!\"'),(14,1,'sl','KADAR SLEDITE SVOJI SREÃ„Å’I SE VAM BODO ODPRLA VRATA TAM, KODER STE MISLILI, DA JIH SPLOH NI; IN KODER TUDI NI VRAT ZA NIKOGAR DRUGEGA.'),(15,1,'sl','Cauchyjevi matematiÃ„Âni prispevki so bili briljantni ter so obsegali preko sedemsto Ã„Âlankov. S Cauchyjem se je zaÃ„Âela doba moderne analize. V matematiko je vpeljal standarde preciznosti in strogosti, ki so presegli standarde Leibniza in Newtona.'),(16,1,'sl','Cauchy je najprej napisal obravnavo integralov, ki je postala osnova za moderno kompleksno analizo; nato je sledil Ã„Âlanek o Ã…Â¡irjenju valov v tekoÃ„Âinah, za katerega je dobil nagrado francoske akademije; kasneje pa je napisal Ã„Âlanek, ki predstavlja osnovo moderne teorije elastiÃ„Ânosti.'),(17,1,'sl','Cauchy je zgodnjo izobrazbo pridobil od svojega oÃ„Âeta, odvetnika in mojstra klasike. Najprej se je vpisal na Ã…Â¡tudij inÃ…Â¾enirstva, zaradi slabega zdravja pa so mu svetovali, naj se osredotoÃ„Âi na matematiko. Njegova velika dela so se priÃ„Âela s serijo briljantnih reÃ…Â¡itev nekaterih teÃ…Â¾kih odprtih problemov.'),(18,1,'sl','Fisherjevi zapiski so opredelili statistiko kot posebno podroÃ„Âje prouÃ„Âevanja, katerega metode lahko uporabimo v Ã…Â¡tevilnih panogah. Sistematiziral je matematiÃ„Âno teorijo statistike in izumil Ã…Â¡tevilne nove metode. SluÃ„Âajni primerjalni eksperiment je najbrÃ…Â¾ njegov najveÃ„Âji doseÃ…Â¾ek.'),(19,1,'sl','Ã„Å’loveka osreÃ„Âijo njegovi lastni napori, brÃ…Â¾ ko spozna potrebne prvine za sreÃ„Âo - preproste uÃ…Â¾itke, doloÃ„Âeno mero poguma, nesebiÃ„Ânost, ljubezen do dela in predvsem Ã„Âisto vest. Zdaj sem prepriÃ„Âana, da sreÃ„Âa niso le prazne sanje.'),(20,1,'sl','Ideje in metode, ki jih danes poznamo pod imenom statistika, so v devetnajstem in dvajsetem stoletju izumili ljudje, ki so se ukvarjali s problemi, pri katerih je bilo potrebno analizirati velike koliÃ„Âine podatkov. Astronomija, biologija, druÃ…Â¾boslovne vede in celo geodezija lahko trdijo, da so igrale pomembno vlogo pri rojstvu statistike.'),(21,1,'sl','Ena izmed indijskih pravljic govori o preprostem fantu, ki je stehtal slona pri eni izmed mnogih preizkuÃ…Â¡enj, ki jih je moral prestati. Slona je zapeljal na Ã„Âoln in na eni strani zaznamoval gladino vode. Nato je znosil na Ã„Âoln toliko kamenja, da se je Ã„Âoln znova potopil do oznake. Kamenje je seveda stehtal brez teÃ…Â¾av.'),(22,1,'sl','Po tem, ko se je Pascal prevrnil s konjsko vprego in komaj ostal Ã…Â¾iv, se je spremenil potek njegovega Ã…Â¾ivljenja. Dogodek mu je namreÃ„Â predstavljal skrivnostno opozorilo, da Bogu ni vÃ…Â¡eÃ„Â, da se ukvarja z matematiko. OdloÃ„Âil se je, da se poslej posveti izkljuÃ„Âno premiÃ…Â¡ljevanju o veri in Bogu. Lotil se je pisanja zagovora krÃ…Â¡Ã„Âanstva, a je njegovo delo ostalo nedokonÃ„Âano'),(23,1,'sl','Lagrange je bil sin javnega usluÃ…Â¾benca in se je rodil v Italiji. S Ã…Â¡estnajstimi leti je zaÃ„Âel Ã…Â¡tudirati matematiko kot samouk in bil pri devetnajstih izbran za profesorja na kraljevski  Ã…Â¡oli v Torinu. Naslednje leto je Lagrange poslal Eulerju reÃ…Â¡itve nekaterih slavnih problemov, pri tem pa je uporabil nove metode, ki so se kasneje razvile v vejo analize, ki se imenuje analiza variacij.'),(24,3,'sl','DHEFHAHLHS MR Ã„Å’R QDSZLÃ„Å’ZE M NCLHDCF IHEÃ„Å’RF FZPRFZPCDR. HILRTRECE Ã„Å’R FZPRFZPCUGR HMGHSR SRLÃ„Å’RPGHMPGR PRHLCÃ„Å’R CG ZEAHLCPFCUGR PRHLCÃ„Å’R GZDEÃ„Å’QUGHMPC PRL ILCMIRSZE DEÃ„Å’QUGR ILCMIRSDR D HMGHSZF MPZPCMPUGR FRBZGCDR, MPHBZMPCUGCB ILHJRMHS, PRHLCÃ„Å’R CGOHLFZJCÃ„Å’R, FRBZGCDR PRDHUCG 